@dev Automated queue-based marketplace for purchasing ad slots on in-game walls.

Recommended Ad Image Size: 1200 x 630 pixels (1.9:1 ratio)
Supported formats: PNG, JPG, WebP

16 parallel tracks: Ads are automatically queued to the track that opens up soonest.

